  \"selection-of-biosphere-reserves-for-the-californian-biogeographical-province-final-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Completion of the biosphere reserve network
  within the United States is a major objective of the United States Man and the Biosphere
  Program (US MAS). Toward this end, US MAS and its Project Directorate on Biosphere
  Reserves established an ad hoc panel to identify, evaluate, and select sites which
  met US MAB criteria for nomination as biosphere reserves within the Californian
  biogeographical province. The binational panel is chaired by Prof. Harold A. Mooney
  of Stanford University and includes authorities on the chaparral, grassland, and
  woodland ecosystems of the Californian province. The members represent federal and
  state agencies, state and private universities, and private organizations.             This
  report includes justifications for each proposed biosphere reserve based on the
  panel's scientific review using criteria established by UNESCO in 1974 and 1983.
  In some cases it was possible to determine support for the biosphere reserve among
  site administrators and to make preliminary assessments of feasibility. The Golden
  Gate -Point Reyes -Farallones Region Biosphere Reserve is strongly supported by
  site administrators, and the panel recommends that US MABinvite administrators to
  officially endorse the nomination. For each of the other three clusters, US MABshould
  make efforts to establish support by convening managers' workshops, and, if needed,
  by sponsoring a feasibility study.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
